        public static string getWeenieClassName(int id)
        {
            string value;
            if (instance.map.TryGetValue(id, out value))
                return Utils.ReplaceStringSpecialCharacters(value);
            return "";
        }

        public static string compileWeenieClassName(int id)
        {
            string value;
            if (instance.map.TryGetValue(id, out value))
                return $"{id.ToString()} ({value})";
            return $"{id.ToString()} ()";
        }

